function setupTreelist() {
    let items = collectOrphans();

    if (items.length == 0) {
        RED.notify("No Orphans Found", {
            type: "warning",
            timeout: 2000
        });

        try {
            $("#node-input-orphan-target-container-div").treeList('empty')
        } catch (ex) { }
    } else {
        try {
            $("#node-input-orphan-target-container-div").treeList('empty')
        } catch (ex) {
            $("#node-input-orphan-target-container-div").css({
                width: "100%",
                height: "calc(100%)"
            }).treeList(
                {
                    multi: false
                }
            ).on("treelistitemmouseover", function (e, item) {
                if (item.node && item.node.z == RED.workspaces.active()) {
                    RED.view.reveal(item.node.id, true);
                    RED.view.redraw();
                }
            }).on("treelistitemmouseout", function (e, item) {
            }).on('treelistselect', function (event, item) {
                if (item.node) {
                    RED.workspaces.show(item.node.z, false, false, true);
                    RED.view.reveal(item.node.id, true)
                    RED.view.redraw();
                }
            }).on('treelistconfirm', function (event, item) {
                if (item.node) {
                    var ndeid = item.node.id;

                    setTimeout(() => {
                        const nodeToShow = RED.nodes.node(ndeid)

                        if (nodeToShow) {
                            RED.view.reveal(nodeToShow.id);
                            RED.view.select(nodeToShow.id);
                            RED.editor.edit(nodeToShow);
                        }

                        if (ndeid == RED.workspaces.active()) {
                            RED.workspaces.edit()
                        }
                    }, 50);
                }
            });

            $("#node-input-orphan-target-filter").show();

            var search = $("#node-input-orphan-target-filter").searchBox({
                style: "compact",
                delay: 300,
                change: function () {
                    var val = $(this).val().trim().toLowerCase();
                    if (val === "") {
                        $("#node-input-orphan-target-container-div").treeList("filter", null);
                        search.searchBox("count", "");
                    } else {
                        var count = $("#node-input-orphan-target-container-div").treeList("filter", function (item) {
                            return item.label.toLowerCase().indexOf(val) > -1 || item.node.type.toLowerCase().indexOf(val) > -1
                        });

                        search.searchBox("count", count + " / " + $("#node-input-orphan-target-container-div").treeList("data").length);
                    }
                }
            });
        }
        $("#node-input-orphan-target-container-div").treeList("data", items.sort((a, b) => a.node.z > b.node.z))
    }
}
function collectOrphans() {
    /* ***************
     * code taken from
     *   https://discourse.nodered.org/t/search-for-orphan-nodes/77783/3
     */
    const connectedNodes = new Set()
    var candidateNodes = [];

    // Iterate over all links, add the nodes to the 'connected' set
    RED.nodes.eachLink(link => { connectedNodes.add(link.source); connectedNodes.add(link.target) })
    // Iterate over all nodes, add any not in the connected set to the disconnected set
    RED.nodes.eachNode(node => { if (!connectedNodes.has(node)) candidateNodes.push(node) })
    /************ done code borrowing ************/

    var items = [];
    var nodeItemMap = {};

    candidateNodes.forEach(function (n) {
        var nodeDef = RED.nodes.getType(n.type);
        var label;
        var sublabel;

        if (nodeDef) {
            var l = nodeDef.label;
            label = (typeof l === "function" ? l.call(n) : l) || "";
            sublabel = n.type;

            if (sublabel.indexOf("subflow:") === 0) {
                return;

                var subflowId = sublabel.substring(8);
                var subflow = RED.nodes.subflow(subflowId);
                sublabel = "subflow : " + subflow.name;
            }
        }

        if (!nodeDef || !label) {
            label = n.type;
        }
        nodeItemMap[n.id] = {
            node: n,
            label: label,
            sublabel: sublabel,
            selected: false,
            checkbox: false
        };
        items.push(nodeItemMap[n.id]);
    });

    return items;
}

 function nr_intro_generate_svg_3_1( red ) {
   //****
   // Node-RED 3.1.x has multiple SVGs all over the place, so we
   // need to look for the one with 8000x8000.
   // Tested this on Node-RED 3.1.0.beta.4 - dunno about other 3.1.x.beta.y
   //****

   return (callbackWithSvgCode) => {
     try {
       handleSvgObject( $($('svg[width=8000]')[0]), callbackWithSvgCode );
     } catch ( e ) {
       var msg = "Error Generating SVG: " + JSON.stringify(e);

       red.notify(msg,{ type: "error" });

       var svgData = '<?xml version="1.0" encoding="UTF-8" standalone="no"?><svg width="1000" height="1000" viewBox="0 0 1000 1000" pointer-events="all" style="cursor: crosshair; touch-action: none;" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"><style>.small { font: bold 20px sans-serif; fill: red;}</style><text x="10" y="30" class="small">'+msg+'</text></svg>';

       callbackWithSvgCode(svgData);
     }
   }
 }

